var uiVersionPromise = getUiVersion();

window.analytics = {
    sendAnalyticsEvent: function(eventName) {
        if (!wkVars.enableEventTracking) {
            return Promise.resolve();
        }

        return uiVersionPromise.then(function(uiVersion) {
            var timestamp = '_ts=' + Date.now();
            var userData = {};
            var addEventUrl = wkVars['velvet-host'] + '/recording-v1.svc/AddEvent?' + timestamp;
            var browserName = bowser.name.toLowerCase();
            var browserAttribute = browserName + ' ' + bowser.version;
            var osName = bowser.osname.toLowerCase();
            var osAttribute = osName + ' ' + osName + '-' + bowser.osversion;
            var tabIdAttribute = Date.now() + '_' + Math.random();
            var targetUiUrl = location.search;
            try {
                targetUiUrl = decodeURIComponent(targetUiUrl);
            } catch (error) {}
            var linksource = targetUiUrl.match(/linksource=([\w]+)/);
            var AXCESS_NAME = 'axcess';

            linksource = linksource ? linksource[1] : null;

            if (linksource === AXCESS_NAME) {
                userData.linksource = AXCESS_NAME;
            }
            userData.eventType = 'click';
            userData.pageFrom = document.URL;
            userData.browser = browserAttribute;
            userData.os = osAttribute;
            userData.screenWidth = window.innerWidth;
            userData.screenHeight = window.innerHeight;
            userData.uiVersion = uiVersion;
            userData.tabId = tabIdAttribute;

            var requestBody = '';

            Object.keys(userData).forEach(function(attributeName) {
                requestBody = requestBody.concat('attribute=', attributeName + '!' + userData[attributeName], '&');
            });
            requestBody = requestBody.concat('code=', eventName);

            return new Promise(function(resolve) {
                var eventRequest = new XMLHttpRequest();

                eventRequest.open('POST', addEventUrl);

                eventRequest.setRequestHeader('Content-Type', 'application/x-www-form-urlencoded');
                eventRequest.setRequestHeader('X-ApiKey', wkVars['velvet-apikey']);
                eventRequest.setRequestHeader('x-cpid', wkVars.osaProductConfig.default.headers['x-cpid']);
                eventRequest.setRequestHeader('x-tunnel-status-code', 401);

                eventRequest.onload = function() {
                    resolve(eventRequest.response);
                };
                eventRequest.onerror = function() {
                    resolve(eventRequest.response);
                };

                eventRequest.send(requestBody);
            });
        });
    }
};

function getUiVersion() {
    return new Promise(function(resolve) {
        var versionRequest = new XMLHttpRequest();

        versionRequest.open('GET', './_versions.txt');

        versionRequest.onload = function() {
            if (this.status >= 200 && this.status < 300) {
                var versionResponse = versionRequest.response.match(/csn:(\d+\.\d+\.\d+)/);

                versionResponse = versionResponse ? versionResponse[1] : '';
                resolve(versionResponse);
            } else {
                resolve('');
            }
        };
        versionRequest.onerror = function() {
            resolve('');
        };

        versionRequest.send();
      });
}

(function(win) {
    win.history.pushState(null, null, win.location.href);
    win.onpopstate = function () {
        win.history.forward();
    };
    win.history.back();
})(window);

